  property("GetSignatures network message should be binary compatible") {
    forAll(binaryGetSignaturesMessages) { (message, signatures) =>
      val bytes = Base58.decode(message).get
      val restoredMessage = pool.fromBytes(bytes, classOf[NetworkMessage])
      restoredMessage.contentId shouldEqual 20

      val content = pool.fromBytes(restoredMessage.content, classOf[GetSignaturesMessageContentV1])
      val sigs = signatures.split(",").filter(_.nonEmpty).map(s => Base58.decode(s).get).toSeq
      content.blockIds should contain theSameElementsAs sigs
    }
  }

  val SignatureGenerator = Gen.containerOfN[Array, Byte](64, Arbitrary.arbByte.arbitrary)
  val SignaturesGenerator = Gen.containerOf[Seq, Array[Byte]](SignatureGenerator)

  property("GetSignatures network message should be deserializable by old code") {
    forAll(SignaturesGenerator) { signatures =>
      val content = GetSignaturesMessageContentV1(signatures)
      val contentBytes = pool.toBytesWithoutClass(content)
      val message = NetworkMessage(content.id, contentBytes)
      val messageBytes = pool.toBytesWithoutClass(message)

      println(s"('${Base58.encode(messageBytes)}', '${signatures.map(Base58.encode(_)).mkString(",")}'),")
    }
  }

