  property("Signatures network messages should be binary compatible") {
    forAll(binarySignaturesMessages) { (message, signatures) =>
      val bytes = Base58.decode(message).get
      val restoredMessage = pool.fromBytes(bytes, classOf[NetworkMessage])
      restoredMessage.contentId shouldEqual 21

      val content = pool.fromBytes(restoredMessage.content, classOf[SignaturesMessageContentV1])
      val sigs = signatures.split(",").filter(_.nonEmpty).map(s => Base58.decode(s).get).toSeq
      content.signatures should contain theSameElementsAs sigs
    }
  }

  property("Signatures network message should be deserializable by old code") {
    forAll(SignaturesGenerator) { signatures =>
      val content = SignaturesMessageContentV1(signatures)
      val contentBytes = pool.toBytesWithoutClass(content)
      val message = NetworkMessage(content.id, contentBytes)
      val messageBytes = pool.toBytesWithoutClass(message)

      println(s"('${Base58.encode(messageBytes)}', '${signatures.map(s => Base58.encode(s)).mkString(",")}'),")
    }
  }

